import React from "react";

const Myblocimg = props => {
  console.log(props);

  return (
    <div className="d-flex flex-row">
      {props.mesDonnees.map(blocMyImg => (
        <div className="container ">
          <img src={blocMyImg.img} alt="img" />
        </div>
      ))}
    </div>
  );
};

export default Myblocimg;
